var isloggedin = false;

function Form(){
    if(isloggedin){
        return <h1>Akshay Nena</h1>
     }
     else{
        return (<div>
        <form>
        <input type="text" placeholder="enter your username"/>
        <input type="text" placeholder="enter your password" />
         
        <button>Register</button>

     </form> 
     </div>);
}
}
export default Form;
